import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => (
    <header className="site-header">
        <div className="container header-container">
            <Link to="/" className="logo-text" style={{ textDecoration: 'none' }}>
                <span style={{
                    background: 'linear-gradient(135deg, #2563eb 0%, #7c3aed 100%)',
                    WebkitBackgroundClip: 'text',
                    WebkitTextFillColor: 'transparent',
                    backgroundClip: 'text',
                    fontWeight: '800',
                    fontSize: '1.5rem',
                    letterSpacing: '-0.02em'
                }}>
                    oneGrasp
                </span>
                {' '}
                <span className="logo-accent" style={{
                    fontWeight: '300',
                    fontSize: '1.5rem',
                    color: '#64748b'
                }}>
                    Events
                </span>
            </Link>
            <nav>
                {/* Placeholder for future nav items if needed */}
            </nav>
        </div>
    </header>
);

const Footer = () => (
    <footer className="site-footer">
        <div className="container footer-content">
            <div className="footer-col">
                <h3>oneGrasp</h3>
                <p>Connecting minds, shaping the future through global conferences.</p>
            </div>
            <div className="footer-copyright">
                &copy; {new Date().getFullYear()} oneGrasp. All rights reserved.
            </div>
        </div>
    </footer>
);

const Layout = ({ children }) => {
    return (
        <div className="app-layout">
            <Header />
            <div className="main-content">
                {children}
            </div>
            <Footer />
        </div>
    );
};

export default Layout;
